double CO2__FP_CritProp_compute_default::CO2__CRYO_PF_CritProp_CORR(const int & chem,const int & fprop,int * ier)
{
	// Local variables:
	double vprop = 0.0;
	double prop_crit[20];
	memset(prop_crit,0,20*sizeof(double));
	int ig = 0;
	int _vi1;
	int _vi2;
	int _vi3;
	if( unkI[1+(chem-1)] == 0 ) {
	ig = setofPos(&typ[0], chem) ;
	unkI[1+(chem-1)] = ig ;
	}
	else {
	ig = unkI[1+(chem-1)] ;
	}
	if( unkI[90+(ig-1)] == 0 ) {
	if( unkS[0] == "" ) {
	unkS[0] = expandFilePath(cteS[176]) ;
	_vi1 = 1 ;
	while ( _vi1 <= setofSize(&typ[0]) ) {
	_vi2 = setofElem(&typ[0], _vi1) ;
	_WR_read_label(cteS[0+(_vi1-1)]) ;
	_vi1 += 1 ;
	}
	_WR_read_cea(88, unkS[0], &unkR[0], &*ier) ;
	}
	WRITE("\n   ******    Reading properties file %s.dat     ******\n",(cteS[88+(chem-1)]).c_str());
	_WR_table_read(" ", ig, unkS[0], cteS[88+(chem-1)], ig, &*ier, &unkR[2176], &unkR[2088+(chem-1)]) ;
	unkI[190] = unkI[190] + 1 ;
	unkI[90+(ig-1)] = unkI[190] ;
	}
	if(!(*ier < 100))
		issueErrorAssert(215,99,24,98,"ADDED_FUNCTIONALITIES.el",41,".","ier < 100","%s","CRYO_PF_CritProp : problems reading thermo properties file");

	if( unkR[88+0+20*(ig-1)] < 0.0001 ) {
	_WR_crit_cond(ig, prop_crit, &*ier) ;
	_vi3 = 1 ;
	while ( _vi3 <= 20 ) {
	if( _vi3 == 1 ) {
	unkR[88+(_vi3-1)+20*(ig-1)] = prop_crit[_vi3-1]/100000. ;
	}
	else {
	unkR[88+(_vi3-1)+20*(ig-1)] = prop_crit[_vi3-1] ;
	}
	_vi3 += 1 ;
	}
	}
	if( fprop == 1 ) {
	vprop = unkR[88+0+20*(ig-1)] ;
		}
	else if( fprop == 2) {
	vprop = unkR[88+1+20*(ig-1)] ;

		}
	else if( fprop == 3) {
	vprop = unkR[88+2+20*(ig-1)] ;

	}
	else {
	if(!(0))
		issueErrorAssert(215,99,24,98,"ADDED_FUNCTIONALITIES.el",65,"."," FALSE ","%s","Property not supported by CRYO_PF_CritProp");

	}
	return vprop ;
}


double CO2__FP_CritProp_compute_default::CRYOLIB__HEPAK_He_X_vs_JN1_JN2(const int & JN1,const int & JN2,const double & X1,const double & X2)
{
	// Local variables:
	int IDID = 0;
	double X = 0.0;
	double X_hepak = 0.0;
	double T = 0.0;
	double PROP[126];
	memset(PROP,0,126*sizeof(double));
	int JOUT = 0;
	double VALU1 = 0.0;
	double VALU2 = 0.0;
	int NUNITS = 0;
	double T_c = 5.1953;
	NUNITS = 1 ;
	JOUT = 11100 ;
	VALU1 = X1 ;
	VALU2 = X2 ;
	_WR_CALC(&IDID, PROP, JOUT, JN1, VALU1, JN2, VALU2, cteI[1], NUNITS) ;
	if(!(IDID > 0))
		issueErrorAssert(213,7,24,98,"EL_01_Functions.el",560,".","IDID > 0","%s","Failure in HEPAK_He_X_vs_JN1_JN2");

	X_hepak = PROP[0] ;
	T = PROP[2] ;
	if( X_hepak > 1 ) {
	X = 1. ;
		}
	else if( X_hepak == -1 && T > T_c) {
	X = 1. ;

		}
	else if( X_hepak <= -1 && T < T_c) {
	X = 0. ;

	}
	else {
	X = X_hepak ;
	}
	return X ;
}


