double CO2__FP_CritProp_compute_default::CRYOLIB__HEPAK_He_prop_vs_ph(const double & p,const double & h,const int & n_prop)
{
	// Local variables:
	int IDID = 0;
	double prop = 0.0;
	double PROP[126];
	memset(PROP,0,126*sizeof(double));
	int JOUT = 0;
	int JN1 = 0;
	double VALU1 = 0.0;
	int JN2 = 0;
	double VALU2 = 0.0;
	int NUNITS = 0;
	int fprop = 1;
	int ier = 0;
	double X = 0.0;
	double var_f = 0.0;
	double var_g = 0.0;
	double rho_f = 0.0;
	double rho_g = 0.0;
	double alpha = 0.0;
	NUNITS = 1 ;
	JOUT = 11100 ;
	JN1 = 1 ;
	JN2 = 6 ;
	VALU1 = p * 100000. ;
	VALU2 = h ;
	_WR_CALC(&IDID, PROP, JOUT, JN1, VALU1, JN2, VALU2, cteI[1], NUNITS) ;
	if(!(IDID > 0))
		issueErrorAssert(213,7,24,98,"EL_01_Functions.el",861,".","IDID > 0","%s","Failure in the calculation of the property in HEPAK_He_prop_vs_ph");

	X = PROP[0] ;
	if( X < 1 && X > 0 ) {
	if( n_prop == 14 ) {
	var_f = PROP[56] ;
	var_g = PROP[98] ;
	prop = X * var_g + (1. - X) * var_f ;
		}
	else if( n_prop == 25) {
	var_f = PROP[67] ;
	var_g = PROP[109] ;
	prop = X * var_g + (1. - X) * var_f ;

		}
	else if( n_prop == 26) {
	var_f = PROP[68] ;
	var_g = PROP[110] ;
	prop = X * var_g + (1. - X) * var_f ;

		}
	else if( n_prop == 20) {
	var_f = PROP[62] ;
	var_g = PROP[104] ;
	rho_f = PROP[45] ;
	rho_g = PROP[87] ;
	alpha = _div( _div( X , rho_g,"rho_g") , (_div( X , rho_g,"rho_g") + _div( (1. - X) , rho_f,"rho_f")),"X / rho_g + (1 - X) / rho_f") ;
	prop = MATH__max(0.01, _div( 1. , ssqrt(PROP[3] * (_div( _div( _div( alpha , rho_g,"rho_g") , var_g,"var_g") , var_g,"var_g") + _div( _div( _div( (1. - alpha) , rho_f,"rho_f") , var_f,"var_f") , var_f,"var_f"))),"ssqrt(PROP[004] * (alpha / rho_g / var_g / var_g + (1 - alpha) / rho_f / var_f / var_f))")) ;

		}
	else if( n_prop == 17) {
	var_f = PROP[59] ;
	var_g = PROP[101] ;
	prop = X * var_g + (1. - X) * var_f ;

		}
	else if( n_prop == 16) {
	var_f = PROP[58] ;
	var_g = PROP[100] ;
	prop = X * var_g + (1. - X) * var_f ;

		}
	else if( n_prop == 27) {
	var_f = PROP[69] ;
	var_g = PROP[111] ;
	prop = X * var_g + (1. - X) * var_f ;

	}
	else {
	prop = PROP[n_prop + 1-1] ;
	}
	}
	else {
	prop = PROP[n_prop + 1-1] ;
	}
	return prop ;
}


double CO2__FP_CritProp_compute_default::CRYOLIB__CRYO_PF_prop_vs_ph(const int & chem,const double & p_bar,const double & h,const int & fprop,int * ier,int * jx,int * jy)
{
	// Local variables:
	double p = 0.0;
	double x = 0.0;
	double vprop = 0.0;
	int ig = 0;
	int _vi4;
	int _vi5;
	p = p_bar * 100000. ;
	if( unkI[89] == 1 && chem == 13 ) {
	if( cteI[23+(fprop-1)] == 0 ) {
	vprop = CRYOLIB__HEPAK_He_X_vs_JN1_JN2(1, 6, p, h) ;
	}
	else {
	vprop = CRYOLIB__HEPAK_He_prop_vs_ph(p_bar, h, cteI[23+(fprop-1)]) ;
	}
		}
	else if( unkI[89] == 1 && chem != 13) {
	if(!(0))
		issueErrorAssert(215,99,24,98,"EL_01_Functions.el",2392,"."," FALSE ","%s","HEPAK properties not defined for working fluids that are not helium");


	}
	else {
	if( unkI[0] == 1 && chem == 13 ) {
	if( fprop == 2 ) {
	vprop = interpHist2D(&unkT[3], 4, 4, p_bar, h, &*jx, &*jy) ;
		}
	else if( fprop == 3) {
	vprop = interpHist2D(&unkT[1], 4, 4, p_bar, h, &*jx, &*jy) ;

		}
	else if( fprop == 8) {
	vprop = interpHist2D(&unkT[2], 4, 4, p_bar, h, &*jx, &*jy) ;

		}
	else if( fprop == 6) {
	vprop = interpHist2D(&unkT[4], 4, 4, p_bar, h, &*jx, &*jy) ;

		}
	else if( fprop == 10) {
	vprop = interpHist2D(&unkT[0], 4, 4, p_bar, h, &*jx, &*jy) ;

		}
	else if( fprop == 14) {
	vprop = interpHist2D(&unkT[6], 4, 4, p_bar, h, &*jx, &*jy) ;

		}
	else if( fprop == 15) {
	vprop = interpHist2D(&unkT[8], 4, 4, p_bar, h, &*jx, &*jy) ;

		}
	else if( fprop == 16) {
	vprop = interpHist2D(&unkT[7], 4, 4, p_bar, h, &*jx, &*jy) ;

		}
	else if( fprop == 19) {
	vprop = interpHist2D(&unkT[5], 4, 4, p_bar, h, &*jx, &*jy) ;

	}
	else {
	if(!(0))
		issueErrorAssert(215,99,24,98,"EL_01_Functions.el",2414,"."," FALSE ","%s","Non Accounted property in He_prop_vs_PH");

	}
	}
	else {
	if( unkI[1+(chem-1)] == 0 ) {
	ig = setofPos(&typ[0], chem) ;
	unkI[1+(chem-1)] = ig ;
	}
	else {
	ig = unkI[1+(chem-1)] ;
	}
	if( unkI[90+(ig-1)] == 0 ) {
	if( unkS[0] == "" ) {
	unkS[0] = expandFilePath(cteS[176]) ;
	_vi4 = 1 ;
	while ( _vi4 <= setofSize(&typ[0]) ) {
	_vi5 = setofElem(&typ[0], _vi4) ;
	_WR_read_label(cteS[0+(_vi4-1)]) ;
	_vi4 += 1 ;
	}
	_WR_read_cea(88, unkS[0], &unkR[0], &*ier) ;
	}
	WRITE("\n   ******    Reading properties file %s.dat     ******\n",(cteS[88+(chem-1)]).c_str());
	_WR_table_read(" ", ig, unkS[0], cteS[88+(chem-1)], ig, &*ier, &unkR[2176], &unkR[2088+(chem-1)]) ;
	unkI[190] = unkI[190] + 1 ;
	unkI[90+(ig-1)] = unkI[190] ;
	}
	if(!(*ier < 100))
		issueErrorAssert(215,99,24,98,"EL_01_Functions.el",2438,".","ier < 100","%s","Problems reading thermo properties file");

	if(!(cteI[3+(fprop-1)] > 0 || fprop == 19))
		issueErrorAssert(215,99,24,98,"EL_01_Functions.el",2439,".","CRYOLIB.nprop[fprop] > 0 OR fprop == fprop_quality","%s","The selected property is not available ");

	_WR_thermo_prop_vs_xy(ig, 1, p, 5, h, cteI[3+(fprop-1)], &vprop, &*ier, &p, &x, cteI[0], &*jx, &*jy) ;
	if( fprop == 19 ) {
	vprop = x ;
	}
	}
	}
	return vprop ;
}


